  const [activeTab, setActiveTab] = useState('hd-voice');
  const [isCalling, setIsCalling] = useState(false);

  const handleCall = async () => {
    if (isCalling) return;

    setIsCalling(true);

    try {
      console.log('Iniciando chamada via Vapi Widget...');

      // Aguarda um pouco para o widget carregar completamente
      await new Promise(resolve => setTimeout(resolve, 1000));

      // Procura pelo widget Vapi na p√°gina
      const vapiWidget = document.querySelector('vapi-widget');

      if (vapiWidget) {
        console.log('Widget Vapi encontrado:', vapiWidget);

        // Tenta v√°rias formas de encontrar e clicar no bot√£o
        const buttonSelectors = [
          'button[data-testid="start-button"]',
          'button[data-testid="start-call-button"]',
          '.vapi-button',
          '.start-button',
          '.call-button',
          'button'
        ];

        let startButton = null;

        // Tenta encontrar o bot√£o no shadow DOM primeiro
        if (vapiWidget.shadowRoot) {
          console.log('Tentando encontrar bot√£o no shadow DOM...');
          for (const selector of buttonSelectors) {
            startButton = vapiWidget.shadowRoot.querySelector(selector);
            if (startButton) {
              console.log('Bot√£o encontrado no shadow DOM:', startButton);
              break;
            }
          }
        }

        // Se n√£o encontrou no shadow DOM, tenta no DOM normal
        if (!startButton) {
          console.log('Tentando encontrar bot√£o no DOM normal...');
          for (const selector of buttonSelectors) {
            startButton = document.querySelector(selector);
            if (startButton) {
              console.log('Bot√£o encontrado no DOM:', startButton);
              break;
            }
          }
        }

        // Tenta encontrar por texto
        if (!startButton) {
          console.log('Tentando encontrar bot√£o por texto...');
          const allButtons = document.querySelectorAll('button');
          for (const button of allButtons) {
            const text = button.textContent.toLowerCase();
            if (text.includes('start') || text.includes('iniciar') || text.includes('call') || text.includes('ligar') || text.includes('teste agora')) {
              startButton = button;
              console.log('Bot√£o encontrado por texto:', button);
              break;
            }
          }
        }

        if (startButton) {
          startButton.click();
          console.log('Bot√£o clicado com sucesso!');
        } else {
          // Como √∫ltimo recurso, tenta usar a API do Vapi se dispon√≠vel
          if (window.vapiSDK) {
            console.log('Tentando usar SDK do Vapi diretamente...');
            const vapiInstance = window.vapiSDK.run({
              apiKey: "5bf919cf-4f0b-4219-ab02-74722fbc0eb5",
              assistant: "3a43dfa8-674a-4976-964b-c6729ecccad3",
              config: {
                position: "hidden"
              }
            });
            await vapiInstance.start();
            console.log('Chamada iniciada via SDK!');
          } else {
            throw new Error('N√£o foi poss√≠vel encontrar o bot√£o de iniciar chamada');
          }
        }
      } else {
        throw new Error('Widget Vapi n√£o encontrado na p√°gina');
      }

    } catch (error) {
      console.error('Erro ao iniciar chamada:', error);
      alert(`Erro ao conectar com o agente: ${error.message}`);
    } finally {
      setTimeout(() => setIsCalling(false), 3000);
    }
  };

  const tabs = [
    { id: 'hd-voice', label: 'Voz HD IA' },
    { id: 'text-to-speech', label: 'Texto para Voz' },
    { id: 'speech-to-text', label: 'Voz para Texto' }
  ];

  const renderContent = () => {
    switch (activeTab) {
      case 'hd-voice':
        return (
          <div className="test-content">
            <div className="test-header">
              <h3 className="test-title">VOZ HD IA</h3>
              <h4 className="test-subtitle">Voz HD verdadeira, ponta a ponta</h4>
            </div>
            <p className="test-description">
              Vozes NaturalHD pr√≥prias e codecs de voz HD s√£o alimentados por nossa rede global privada para entregar conversas mais naturais com clareza de chamada incompar√°vel.
            </p>
            <p className="test-highlight">Experimente a diferen√ßa na qualidade da voz</p>
            <div className="test-options">
              <button className="option-btn active">Vozes HD+ NaturalHD</button>
              <button className="option-btn">Codec padr√£o</button>
            </div>
            <button 
              className={`btn btn-primary btn-large ${isCalling ? 'calling' : ''}`} 
              onClick={handleCall}
              disabled={isCalling}
            >
              <span className="btn-icon">{isCalling ? '‚è≥' : 'üìû'}</span>
              {isCalling ? 'CONECTANDO...' : 'LIGAR AGORA'}
            </button>
          </div>
        );

      case 'text-to-speech':
        return (
          <div className="test-content">
            <div className="test-header">
              <h3 className="test-title">TEXTO PARA VOZ</h3>
              <h4 className="test-subtitle">Convers√£o de texto para voz</h4>
            </div>
            <p className="test-description">
              Aproveite vozes claras e naturais para uma melhor experi√™ncia de chamada com seus clientes.
            </p>
            <div className="test-input">
              <input 
                type="text" 
                placeholder="Digite sua mensagem aqui..." 
                className="form-input"
              />
              <button className="btn btn-secondary">Converter para Voz</button>
            </div>
            <button 
              className={`btn btn-primary btn-large ${isCalling ? 'calling' : ''}`} 
              onClick={handleCall}
              disabled={isCalling}
            >
              <span className="btn-icon">{isCalling ? '‚è≥' : 'üé§'}</span>
              {isCalling ? 'CONECTANDO...' : 'LIGAR AGORA'}
            </button>
          </div>
        );

      case 'speech-to-text':
        return (
          <div className="test-content">
            <div className="test-header">
              <h3 className="test-title">VOZ PARA TEXTO</h3>
              <h4 className="test-subtitle">Transcri√ß√£o em tempo real</h4>
            </div>
            <p className="test-description">
              Transforme √°udio em texto com precis√£o natural para conte√∫do, comunica√ß√£o e acessibilidade.
            </p>
            <div className="test-buttons">
              <button className="btn btn-secondary">
                <span className="btn-icon">üî¥</span>
                GRAVAR √ÅUDIO
              </button>
              <button className="btn btn-secondary">
                <span className="btn-icon">üìÅ</span>
                ENVIAR ARQUIVO
              </button>
            </div>
            <button 
              className={`btn btn-primary btn-large ${isCalling ? 'calling' : ''}`} 
              onClick={handleCall}
              disabled={isCalling}
            >
              <span className="btn-icon">{isCalling ? '‚è≥' : 'üìû'}</span>
              {isCalling ? 'CONECTANDO...' : 'LIGAR AGORA'}
            </button>
          </div>
        );

      default:
        return null;
    }
  };

  return (
    <section className="test-section bg-white">
      <div className="container">
        <div className="test-container">
          <div className="test-tabs">
            {tabs.map((tab) => (
              <button
                key={tab.id}
                className={`test-tab ${activeTab === tab.id ? 'active' : ''}`}
                onClick={() => setActiveTab(tab.id)}
              >
